import subprocess


class Test:
    def __init__(self):
        self.strcmd = 'python -m grpc_tools.protoc --python_out=. --grpc_python_out=. -I. BaseType.proto'

    def run(self):
        result = subprocess.Popen(self.strcmd)
        print(result)

if __name__ == '__main__':
    te = Test()
    te.run()